output: default
groups: {}
asyncFuncTimeout: 1000
functions:
  - id: serde
    filter: "true"
    disabled: null
    conf:
      mode: reserialize
      type: json
      srcField: _raw
      remove:
        - Config*
        - Entitlements
        - name
        - Timeout
      fieldFilterExpr: " value && value !== 'null'"
      keep: []
